import React from 'react';
import classes from './post.module.css';
 const Post = (posts) =>
 {
     return(
         <div className={classes.blockComment}>
             <div className={classes.imgIconsProfile}>

             </div>
             <div className={classes.textComment}>
                 <p>Текст: {posts.message}</p>
                 <span>Like: {this.props.like}</span>
             </div>
         </div>
     );
 }
 export default Post;
